import React from "react";
import {
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardImage,
  MDBCardBody,
  MDBBadge
} from "mdbreact";

const EcommercePage = () => {
  return (
    <MDBRow className="justify-content-center">
      <MDBCol style={{ maxWidth: "480px" }}>
        <div
          style={{
            height: "100vh",
            backgroundColor: "#377C4E",
            textAlign: "center"
          }}
        >
          <br></br>
          <h1 className="">Sampah Online</h1>
        </div>
      </MDBCol>
    </MDBRow>
  );
};

export default EcommercePage;
